using System;
using System.Collections.Generic;
using System.Linq;
using System.Threading.Tasks;

using Xunit;
using Amazon.Lambda.Core;
using Amazon.Lambda.TestUtilities;
using Amazon.Lambda.APIGatewayEvents;

using ReturnCat;

namespace ReturnCat.Tests
{
    public class FunctionTest
    {
        [Fact]
        public async void TestToUpperFunction()
        {

            // Invoke the lambda function and confirm the string was upper cased.
            var function = new Function();
            var context = new TestLambdaContext();
            APIGatewayProxyRequest a = new APIGatewayProxyRequest();
            Dictionary<string, string> dict = new Dictionary<string, string>();
            dict.Add("code", "599");
            a.QueryStringParameters = dict;
            var upperCase = await function.FunctionHandler(a, context);

            Assert.Equal("", upperCase);
        }
    }
}
